import React from 'react';
import styled , {keyframes} from "styled-components";
import './Text.css'

export default function TextAnm(){
    return(
      <>
        <Wrapper className='text' data-text="Hello My Name is Mo. Kaif Siddique">Hello My Name is Mo. Kaif Siddique</Wrapper>
        <div>Hello My Name is Mo. Kaif Siddique</div>
      </>
    )
}

const animation = keyframes `
0%{
  width:0;
}
70%,90%{
  width:60%;
}
`
const Wrapper = styled.div`
  animation-name : ${animation};
  animation-duration : 4s;
  animation-iteration-count: infinite;
  animation-delay: 0ms;
`
